CREATE DEFINER=`root`@`localhost` FUNCTION `promedio_ventas_por_anio_y_region`(anio_param INT, region_param VARCHAR(255)) RETURNS decimal(10,2)
    READS SQL DATA
BEGIN
    DECLARE promedio DECIMAL(10,2) DEFAULT 0.00;

    -- Calcula el promedio de ventas para el ao y la regin especificados
    SELECT AVG(total_venta) INTO promedio
    FROM vista_ventas_sucursales
    WHERE anio = anio_param AND region = region_param;

    RETURN promedio;
END ;;
